// react
import React, { Component } from 'react';

// third-party
import PropTypes from 'prop-types';
import { Helmet } from 'react-helmet';
import { Link, Redirect, Route, Switch } from 'react-router-dom';
import { Breakpoint, BreakpointProvider } from 'react-socks';

// application
import Footer from './footer';
import Header from './header';
import QuickSearch from './QuickSearch';



export class SearchLayout extends Component {
    render() {
        return (
            <React.Fragment>
                <Helmet>
                    <title>Drugi test</title>
                    <meta name="description" content="drugi test desc" />
                </Helmet>

                <div className="ekat__main">
                    <header className="ekat__header">
                        <Header />
                    </header>

                    <div className="ekat__body">
                        <div className="ekat-search">
                            <div className="ekat-search__quick-search">
                                <QuickSearch />
                            </div>

                            <div className="ekat-search__main">
                                <div className="ekat-search__menu">
                                    test
                                </div>
                                <div className="ekat-search__body">
                                    {this.props.children}
                                </div>
                            </div>
                        </div>
                    </div>

                    <footer className="ekat__footer">
                        <Footer />
                    </footer>
                </div>                
            </React.Fragment>
        );
    }
}
